function remove(n){const t=$("#userId").val();swal({title:"Sure to remove this role?",type:"warning",showCancelButton:!0},function(){app.delete("/api/user/"+t+"/role/"+n,function(){window.location.reload()},function(){swal("Error","Delete failed","error")})})}function addRole(){const t=$("#userId").val(),n=$(".select2").val();n&&app.post("/api/user/"+t+"/role/"+n,null,function(){window.location.reload()},function(n){swal("Error",n?n:"Add failed","error")})}